import React, { useEffect } from 'react';
import $ from 'jquery';
import DataTable from 'datatables.net-dt';
import './App.css';

const App = () => {
  useEffect(() => {
    const table = new DataTable('#example');

    return () => {
      table.destroy();
    };
  }, []);

  return (
    <div className="container">
      <h1>Patient DataTable</h1>
      <table id="myTable" class="display">
        <thead>
          <tr>
            <th>Column 1</th>
            <th>Column 2</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Row 1 Data 1</td>
            <td>Row 1 Data 2</td>
          </tr>
          <tr>
            <td>Row 2 Data 1</td>
            <td>Row 2 Data 2</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default App;
